C, K = map(int, input().split())

for i in range(K, 10):
    if C % (10**i) < 5*(10**(i-1)):
        C = C - C % (10**i)
    else:
        C = C - C % (10**i) + 10**i

print(C)

c, k = map(int, input().split())

if c % 10**k >= 5*10**(k-1):
    print(c + (10**k - c % 10**k))
else:
    print(c - c % 10**k)
